const App = () => {
  return (
    <div>
      {/* Navigation Bar (AppBar) */}
      <AppBar position="static" style={{height: "55px", paddingTop: "10px"}}>
        <Typography variant="h6" sx={{textAlign : "center"}}>Patient Management System</Typography>
      </AppBar>
      <Box sx={{ width: '100%' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
